package multi_array;

public class multi_array {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int arr[][]= {{2,3,4},{5,6,7}};
		for(int i=0;i<arr.length;i++) {
			for(int j=0;j<arr[i].length;j++) {
				System.out.print(arr[i][j]);
				System.out.print(arr[i][j]);
			}
			System.out.println();
		}

	}

}
